import React, {Component} from 'react'
import CardList from './Cardlist';
import {cats} from './cats';
import SearchBox from './SearchBox'

class App extends Component{
    constructor () {
        super()
        this.state = {
            cats: cats,
            searchfield: ''
        }
    }
    render(){
   return(
       <div className="tc">
           <h1>Cattyfriends</h1>
           <SearchBox/>
           <CardList cats = {cats}/>
        </div>
    );}
}
export default App;
